def make_diag_hadamard_matrix(
    size: int,
    max_size: int | None = None,
    normalize: bool = True,
    dtype=np.float32,
):
  """Generates a Hadamard matrix of the given size.

  Args:
    size: The size of the Hadamard matrix. This represents a single dimension.
      E.g. if size is 4, then the Hadamard matrix is a 4x4 matrix.
    max_size: The maximum size for which to create a Hadamard matrix before
      diagonalizing.
    normalize: If true, scale the matrix with 1 / sqrt(size) making it
      orthonormal (default is `True`).
    dtype: The type of the resulting matrix (default is `np.float32`).

  Returns:
    The Hadamard matrix, and the diagonal replication factor.

  Raises:
    ValueError: If the size is not a power of 2 or multiple of 4, or the matrix
    can otherwise not be constructed.
  """
  max_size = max_size or size
  matrices = {1: np.array([[1]], dtype=dtype)}
  while True:
    # Pop the smallest Hadamard matrix we've got.
    matrices = dict(sorted(matrices.items(), reverse=True))
    curr_size, h = matrices.popitem()

    # Create all possible new Hadamard matrices with it.
    for q, hq in _HADAMARD_MATRICES.items():
      new_size = curr_size * q
      if new_size > max_size:
        break
      if size % new_size == 0 and new_size not in matrices:
        matrices[new_size] = np.kron(h, hq)

    # If we're out of matrices, then the current Hadamard matrix is the best we can do.
    if not matrices:
      break

    # If we've already found the optimal matrix, quit early.
    if max_size in matrices:
      curr_size, h = max_size, matrices[max_size]
      break

  # Normalize the matrix if requested.
  if normalize:
    h = h / np.sqrt(curr_size)

  return h, size // curr_size


def make_hadamard_matrix(size: int, normalize: bool = True, dtype=np.float32):
  """Generates a Hadamard matrix of the given size.

  Args:
    size: The size of the Hadamard matrix. Must be a power of 2. This represents
      a single dimension. E.g. if size is 4, then the Hadamard matrix is a 4x4
      matrix.
    normalize: If true, scale the matrix with 1 / sqrt(size) making it
      orthonormal (default is `True`).
    dtype: The type of the resulting matrix (default is `np.float32`).

  Returns:
    The Hadamard matrix.

  Raises:
    ValueError: If the size is not a power of 2 or multiple of 4, or the matrix
    can otherwise not be constructed.
  """
  if size > 2 and (size & 0x3) != 0:
    raise ValueError('Hadamard matrix size must be  1, 2, or a multiple of 4.')
  h, rem = make_diag_hadamard_matrix(size, normalize=normalize, dtype=dtype)
  if rem > 1:
    raise ValueError('Unable to construct a Hadamard matrix for size %i.', size)
  return h
